function recent_100_data(data){
	var new_data = []
	if (data.length > 100) {
		for (var i = data.length-100; i < data.length; i++) {
			new_data.push(data[i])
			// arr.reverse()
			// new_data = 
			
		}
		// console.log(new_data)
		return new_data
	}else{
		return data
	}

}

